import React from "react";
import './styles Home/css/main.css'
import './styles Home/css/formatoHome.css'
import './styles Home/plugins/fontawesome-free/css/all.min.css'
import './styles Home/dist/css/adminlte.min.css'

class Footer extends React.Component{
render(){
    return(
        <footer class="footer bg-dark rounded-top text-center gradient">
        <div class="container py-2">
            <p class="text-white my-2">
                &copy;Axis - 2021
            </p>
        </div>
    </footer>



    )
}


}
export default Footer
